April 2 ¬∑

If you are having trouble joining Click, Clack Classroom via Google Classroom (all the readings and activities in one place):
1. Try typing code in manually (cut and pasting it from email can lead to error code due to spacing);
2. You may have to use your personal email to log in;
3. Please close out of any other Google Classrooms you may be logged into and try again.
